import '../../Assets/style/style.css';
import './style.css';
const About = () => {
    return (
        <section className="half-black-half-white ">
            <h5
                style={{
                    paddingTop: '20px',
                    textAlign: 'center',
                    fontSize: '60px',
                    fontFamily: 'AvenirRoman',
                    borderBottom: '5px solid white',
                    width: '50px',
                }}
            >
                About
            </h5>
        </section>
    );
};

export default About;
